DESCRIÇÃO.90:
O seguro automóvel pode incluir coberturas facultativas, ou seja, a contratação depende da vontade do tomador do seguro.

 Por exemplo: 
- capital facultativo para o seguro de responsabilidade civil que permite cobrir danos corporais e materiais de valor superior a € 2.500.000 e € 750.000, respetivamente;

- assistência em viagem para o veículo seguro e seus passageiros, o que abrange, em regra, em caso de avaria ou acidente, o reboque do veículo, o transporte de pessoas e bens e o fornecimento de outro veículo até ao final da viagem; 

- proteção jurídica, que cobre os custos de um advogado que represente os interesses do segurado e as despesas decorrentes de um processo judicial ou administrativo; 

- cobertura de privação temporária de uso, que garante o pagamento de uma compensação pelos prejuízos resultantes da impossibilidade de utilização do veículo seguro durante um determinado período (por exemplo, enquanto o veículo está a ser reparado).

DESCRIÇÃO.126:
Em caso de acidente automóvel, deve-se: 

- Obter, no local do acidente, os elementos de identificação dos condutores, veículos e respetivos seguros (o nome do segurador e o número da apólice, que podem ser encontrados num selo destacável que deverá estar colocado no vidro da viatura); 

- Identificar as testemunhas do acidente e recolher os seus contactos (telefone e morada); 

- Depois de chegar a acordo sobre o modo como ocorreu o acidente, os condutores devem preencher e assinar a Declaração Amigável de Acidente Automóvel (DAAA). Cada condutor deve ficar com um exemplar para entregar ao seu segurador. Sempre que possível, deve juntar fotografias dos danos e do local do acidente; 

- Se não for possível chegar a um acordo, cada condutor deve preencher e assinar o seu próprio formulário de DAAA e entregá-lo ao segurador do outro veículo. Nestes casos, é ainda mais importante juntar fotografias dos danos e do local do acidente; 

- Se houver danos corporais deve-se solicitar a presença da polícia. 

Para preencher a DAAA não é necessário que qualquer dos condutores se declare culpado. 

Se o condutor não for responsável pelo acidente, o facto de ter preenchido a DAAA não irá afetar o preço do respetivo seguro.

DESCRIÇÃO.182:
Após ter conhecimento de um sinistro, o segurador tem dois (02) dias úteis para fazer o primeiro contato com o lesado e marcar as peritagens. De seguida, o segurador deve comunicar ao tomador do seguro ou segurado e ao terceiro lesado a sua decisão sobre a responsabilidade pelo acidente num prazo máximo de:
- 30 dias úteis a contar do último dia do prazo para o primeiro contacto, se houver apenas danos materiais (15 dias, com DAAA);
- 45 dias a contar da data do pedido de indemnização, se houver danos corporais.
Estes prazos podem ser alargados ou suspensos se:
- o acidente tiver ocorrido sob condições climatéricas excecionais;
- tiver havido um número excecionalmente elevado de acidentes em simultâneo;
- houver suspeita de fraude.
Se o  segurador decidir assumir a responsabilidade pelos prejuízos resultantes do acidente, deve comunicar a sua decisão por escrito, junto com uma  proposta razoável de indemnização.
No caso de danos corporais, se ainda não houver um relatório de alta clínica ou se o dano não estiver quantificado, a proposta de indemnização é provisória.
Se decidir não assumir a responsabilidade, deve enviar, também por escrito, uma justificação da recusa, devidamente fundamentada.

DESCRIÇÃO.210:
Para calcular o valor da indemnização é preciso determinar o valor do salvado, que é o que resta do veículo sinistrado, e o valor venal, que é o valor pelo qual o veículo poderia ser substituído antes do acidente.
A indemnização a pagar por perda total corresponde: 
- ao valor venal do veículo depois de deduzido o valor do salvado, se o salvado ficar na posse do proprietário; 
- ao valor venal do veículo, se o veículo passar a pertencer ao segurador. Ao propor o pagamento de uma indemnização por perda total, o segurador está obrigado a prestar ao lesado as seguintes informações:
- quem foi a entidade que estimou o custo de reparação dos danos e avaliou se era ou não possível repará-los;
- qual o valor venal do veículo no momento anterior ao acidente;
- qual a estimativa do valor do salvado e quem é a entidade que se compromete a comprá-lo por esse valor. No seguro de danos próprios, se a situação de perda total estiver coberta, o valor da indemnização é calculado de acordo com o que está previsto no contrato.

DESCRIÇÃO.256:
O organismo de indemnização, que em Portugal é o Fundo de Garantia Automóvel, é chamado a pagar as indemnizações se:
- não se souber quem causou o acidente ou qual é o seu segurador; 
- o segurador do causador do acidente não tiver designado um representante para sinistros; 
- o segurador ou o seu representante para sinistros não tiverem dado uma resposta fundamentada ao pedido de indemnização do lesado no prazo de três meses.

DESCRIÇÃO.266:
Se vender o veículo antes do termo do contrato de seguro, o tomador dispõe de duas opções:
- pode solicitar ao segurador a devolução da parte do prémio correspondente ao tempo que ainda faltava para o contrato terminar;
- ou pode manter o seguro e utilizá-lo para segurar outro veículo, que irá substituir o veículo vendido. A substituição tem de ser feita no prazo de 120 dias.

DESCRIÇÃO.1345:
Em caso de morte da pessoa segura, num prazo até dois anos após o acidente que lhe deu causa, é pago aos beneficiários indicados na apólice o valor do capital seguro. Caso não conste algum beneficiário na apólice, a indemnização é atribuída aos herdeiros legais pela seguinte ordem:
1. Cônjuge e descendentes;
2. Cônjuge e ascendentes;
3. Irmãos e seus descendentes;
4. Outros colaterais até ao quarto grau;
5. Estado.
